    false,nt"url": null,nt"notes": "Over the past several years carp have become
    an increasing problem in the management of the Montezuma National Wildlife Refuge
    for Waterfowl. Carp compete directly with waterfowl for the aquatic plants and by
    their feeding activity keep the water muddy so that there is no new growth of the
    more desirable aquatic plants. The successful carp removal program on the Storage
    Pool led naturally to the thought of improving the Main Pool in the same manner.
    This report outlines those efforts.",nt"license_title": "License Not Specified",nt"extras":
